import React from "react";

const ReportTabs = ({setPage}) => {
    return (
        <tab>
            <button onClick = { () => setPage('AllList')}>All</button>
            <button onClick = { () => setPage('WatchList')}>Watch</button>
            <button onClick = { () => setPage('BannedList')}>Banned</button>
            <button onClick = { () => setPage('Updated Logs')}>Updated Logs</button>
        </tab>
    );
}

export default ReportTabs;
